import React from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import axios from "axios";

const FinanceForm = ({ modal, toggle, formData, setFormData, categories, paymentMethods, handleSubmit }) => {
    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    // Submit con JWT
    const handleJwtSubmit = async (e) => {
        e.preventDefault();
        const token = localStorage.getItem("token");
        try {
            await axios.post("http://127.0.0.1:8000/api/finances/", formData, {
                headers: { Authorization: `Bearer ${token}` }
            });
            toggle();
        } catch (err) {
            console.error(err);
        }
    };

    return (
        <Modal show={modal} onHide={toggle} centered>
            <Modal.Header closeButton>
                <Modal.Title>Agregar Finanzas</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <form onSubmit={handleSubmit ? handleSubmit : handleJwtSubmit}>
                    <div className="mb-3">
                        <label className="form-label">Monto</label>
                        <input
                            type="number"
                            className="form-control"
                            name="amount"
                            value={formData.amount}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="mb-3">
                        <label className="form-label">Categoría</label>
                        <input
                            type="text"
                            className="form-control"
                            name="category"
                            value={formData.category}
                            onChange={handleChange}
                            list="categoriesList"
                            required
                        />
                        <datalist id="categoriesList">
                            {categories.map((cat, index) => (
                                <option key={index} value={cat.name} />
                            ))}
                        </datalist>
                    </div>

                    <div className="mb-3">
                        <label className="form-label">Método de Pago</label>
                        <input
                            type="text"
                            className="form-control"
                            name="payment_method"
                            value={formData.payment_method}
                            onChange={handleChange}
                            list="paymentMethodsList"
                            required
                        />
                        <datalist id="paymentMethodsList">
                            {paymentMethods.map((method, index) => (
                                <option key={index} value={method.name} />
                            ))}
                        </datalist>
                    </div>

                    <div className="mb-3">
                        <label className="form-label">Tipo</label>
                        <select
                            className="form-control"
                            name="type"
                            value={formData.type}
                            onChange={handleChange}
                            required
                        >
                            <option value="Expense">Gasto</option>
                            <option value="Income">Ingreso</option>
                        </select>
                    </div>

                    <div className="mb-3">
                        <label className="form-label">Fecha</label>
                        <input
                            type="date"
                            className="form-control"
                            name="create"
                            value={formData.create}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="mb-3">
                        <label className="form-label">Nota</label>
                        <textarea
                            className="form-control"
                            name="note"
                            value={formData.note}
                            onChange={handleChange}
                            rows="3"
                        ></textarea>
                    </div>

                    <Modal.Footer>
                        <Button variant="primary" type="submit">Guardar</Button>
                        <Button variant="secondary" onClick={toggle}>Cancelar</Button>
                    </Modal.Footer>
                </form>
            </Modal.Body>
        </Modal>
    );
};

export default FinanceForm;
